import React from "react";

function GroupBox({ link, groupName }) {
  return (
    <div class="group-box">
      <div class="group-label"></div>
      <img class="group-box img-fluid mb-4 mb-lg-0" src={link} alt="" />

      <h1 class="group-name">{groupName}</h1>
    </div>
  );
}

export default GroupBox;
